import React, { useState, useEffect } from 'react'
import { Container } from '../styled/layoutStyle'
import firebase from '../config'


function History() {
  const [History, setHistory] = useState([]);
  const [Loading, setLoading] = useState(false);
  const firebaseRef = firebase.firestore().collection("History");

  useEffect(() => {
    function getHistory() {
      setLoading(true);
      firebaseRef.get().then((item) => {
        const items = item.docs.map((doc) => doc.data());
        setHistory(items);
        setLoading(false);
      });
    }
    getHistory();
  }, []);
  console.log(History);


  const renderHistory = () => {
      return (
        <Container >
          <table border='1'>
            <tr>
              <thead>
                <th scope="col">Start</th>
                <th scope="col">End</th>
                <th scope="col">Prime count</th>
                <th scope="col">Prime number</th>
              </thead>
              <tbody>
                {History.map((item,i) => (
                  <tr key={i}>
                    <td scope="row">{item.start}</td>
                    <td>
                      {item.end}
                    </td>
                    <td>{item.cntprime}</td>
                    <td>
                      {item.start}
                    </td>
                  </tr>
                ))}
              </tbody>
            </tr>
          </table>



        </Container>
      );
  };

  return (

    <Container>
      <h1>History</h1>
      <div>{renderHistory()}</div>
    </Container>
  )
}

export default History
